import * as api from "../Api/helperApis.js";
export function addTeamToAlliance(team, alliance) {
  api.addTeamToAllianceApi(team, alliance);
}
export const deleteTeam = async (team, teams) => {
  try {
    await helaperApi.deleteTeam(team);
    const data = teams.filter((t) => {
      return t.id !== team.id;
    });
    return data;
  } catch (err) {
    console.log(err);
  }
};
